import React, { useState } from 'react'
import CustomformInput from '../../../../Components/Inputs/Inputs';
import './AddClient.css';
function AddClient() {

const [client,setClient]= useState({});

const onChange=(attribute,value)=>{
    console.log("the field is:",value);
let client1=client;
client1[attribute]=value;
setClient(client1);
};

    return (
        <div className="container">
            <div className="form-container">

            <CustomformInput  value={client.firstname} type="text" placeholder="hedi" onChange={(value)=>{onChange("firstname",value);}} ></CustomformInput>
           
            </div>
        </div>
    )
}

export default AddClient;
